import React from "react";
import TourCard from "../../shared/DoctorCard";
// import tourData from '../../assets/data/tours'
import { Col } from "reactstrap";
import useFetch from "../../hooks/useFetch";
import { BASE_URL } from "../../utils/config";

const AvailableDoctorList = () => {
  const {
    data: availableDoctors,
    loading,
    error,
  } = useFetch(`${BASE_URL}/doctors/search/getAvailableDoctors`);
  // console.log(availableDoctors)

  return (
    <>
      {loading && <h4>Loading.....</h4>}
      {error && <h4>{error}</h4>}
      {!loading &&
        !error &&
        availableDoctors?.map((tour) => (
          <Col lg="3" md="4" sm="6" className="mb-4" key={tour._id}>
            <TourCard tour={tour} />
          </Col>
        ))}
    </>
  );
};

export default AvailableDoctorList;
